import React from 'react';
import PropTypes from 'prop-types';
import css from './Button.module.css';

export const Button = ({onClick}) => {
  return (
    <button className={css.Button} onClick={onClick}>
      Load more
    </button>
  );
};

Button.PropTypes = {
  onClick: pro
};
